import React from 'react'

export default function Card(props) {

  let card = document.getElementsByClassName("card");
  card.style.backgroundColor=""

  return (
        <div className="card">
            <div className='sidediv'>
              <h1>{props.name}</h1>
              <p>{props.text}</p>
            </div>
            <img src={props.image}></img>
        </div>
      )
}
